However, the above query only solves for Paul Chambers. To solve for Bill Evans as well and to find artists that are both musical artists and artists we need a more complex query:
```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>

SELECT ?associatedArtist 
WHERE {
    { dbr:Paul_Chambers dbo:associatedBand ?associatedArtist . }
    UNION
    { dbr:Bill_Evans dbo:associatedBand ?associatedArtist . }
    ?associatedArtist a dbo:MusicalArtist .
    ?associatedArtist a dbo:Artist .
}
```
This query will return the associated musical artists of both Paul Chambers and Bill Evans who are also artists.

